import React from "react";
import { Dropdown, Item } from "semantic-ui-react";
const items = [
  "My Profile",
  "Configuration Notification",
  "Extensions",
  "Log out",
];
const Profile = () => (
  <Dropdown
    style={{ marginRight: "20px" }}
    icon={
      <Item.Image
        avatar
        size="big"
        style={{ float: "left", width: "40px", height: "40px" }}
        src="https://picsum.photos/40/40"
      />
    }
    text="Paul Walker"
  >
    <Dropdown.Menu>
      {items.map((item, id) => (
        <Dropdown.Item key={item + id}>{item}</Dropdown.Item>
      ))}
    </Dropdown.Menu>
  </Dropdown>
);

export default Profile;
